import './hero.styles.css';
import background_image from '../../assets/hero.png';

const Hero = () => {
    return (
        <div className='hero'>
            <div className='hero_image'><img src={background_image}></img></div>
            <div className='hero_footer'>
                <div className='left_part'>
                    <h1>RAIDER X®:</h1>
                    <h2>The Future of Vertical Lift</h2>
                </div>
                <div className='right_part'></div>
            </div>
        </div>
    )
}

export default Hero
